import DayCategories from "./DayCategories"


function Day(props) {

    const categories = Object.values(props.categories)
    console.log("props.categories", props.categories)
    console.log("categories", categories)

    return (
        <div>
            <h1>Day: {props.id}</h1>
            <h1>Categories: {categories.map((category) => <DayCategories key={category.id} id={category.id} cells={category.cells}/> )}</h1>
            <div>

            </div>
        </div>
    )
}

export default Day
